import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import miniLogo from "../../miniLogo.jpeg";
import * as Colors from "material-ui/styles/colors";
import red from "material-ui/colors/red";

const useStyles = makeStyles((theme) => ({
  palette: {
    primary: {
      main: red[500], //OR red['A400'] for the accent range
      contrastText: "#fff", // The text color to use
      // You can also specify light, dark variants to use (it's autocomputed otherwise)
    },
  },
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function ButtonAppBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar className={classes.palette} position="static">
        <Toolbar>
          <img className="miniLogo" src={miniLogo}></img>
          <Typography variant="h6" className={classes.title}>
            Vivid
          </Typography>
          <Button
            color="inherit"
            href="https://github.com/Aneesh-Pothuru/Vivid"
          >
            GitHub
          </Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}
